import React from 'react';
import styles from "./Container7.module.css";
import Lightingdesign from '../../assets/Lightingdesign.png';
import Interiordesign from '../../assets/Interiordesign.png';
import Outdoordesign from '../../assets/Outdoordesign.png';

const Container7 = () => {
    return (
        <div className={styles.container}>
            <h1 className={styles.heading}>Our Services</h1>
            <div className={styles.servicesRow}>
                {[
                    { img: Lightingdesign, title: "Budget - Premium - Luxury", desc: "Comprehensive interior design & Construction services tailored to diverse budgets, guaranteeing excellence and creative solutions for every client." },
                    { img: Interiordesign, title: "Interior Designing & Construction", desc: "From concept to completion, we oversee every detail to bring your vision to life efficiently." },
                    { img: Outdoordesign, title: "Professionals - Corporates - MSMEs", desc: "Celebrate the changing seasons with our seasonal outdoor decor services." }
                ].map((service, index) => (
                    <div key={index} className={styles.service}>
                        <img src={service.img} alt={service.title} />
                        <div className={styles.serviceDesc}>
                            <h3>{service.title}</h3>
                            <p>{service.desc}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Container7;
